import React from "react";
import "./directory.scss";
import MenuItem from "../../Components/menu-item/MenuItem";
const Directory = () => {
	return (
		<div className="directory-menu">
			<MenuItem key={"1"} title={"HATS"} />
			<MenuItem key={"2"} title={"JACKETS"} />
			<MenuItem key={"3"} title={"SNEAKERS"} />
			<MenuItem key={"4"} title={"WOMEN"} />
			<MenuItem key={"5"} title={"MEN"} />
		</div>
	);
};

export default Directory;
